import React from 'react'
import './Components.css';

import {
    Col,
    Row,
    Image
} from 'react-bootstrap';

function SideMenu() {
    return (
        <Row>
            <Col lg={2} style={{background: 'red'}}>
                SideMENU
            </Col>

            <Col lg={10} style={{background: 'blue'}}>
                DASHBOARD
            </Col>

        </Row>
    )
}

export default SideMenu;
